import React from 'react'
import { currentCompanyName, currentRole } from '../Shared/Constant'

function CurrentCompany() {
  return (
    <div
      className="frame f1 text-stone-800 dark:text-white"
      style={{
        width: '100%',
        height: '10vh',
        marginTop: '5vh',
        padding: '10px',
      }}
    >
      <div><strong>Current Company:</strong> {currentCompanyName}</div>
      <div><strong>Designation:</strong> {currentRole}</div>
      <div><strong>Duration:</strong> May 2022 to Present</div>
    </div>
  )
}

export default CurrentCompany
